def binary_to_string(bits):
    # return ''.join([chr(int(i, 2)) for i in bits])
    return [chr(int(i, 2)) for i in bits]


def binary_to_int(bits):
    int_list = []
    for n in bits:
        num = str(n);
        dec_value = 0;
        # Initializing base
        # value to 1, i.e 2 ^ 0
        base1 = 1;

        len1 = len(num);
        for i in range(len1 - 1, -1, -1):
            if (num[i] == '1'):
                dec_value += base1;
            base1 = base1 * 2;
        int_list.append(dec_value)
    return int_list;


def binary_to_hex(bits):
    char = [chr(int(i, 2)) for i in bits]

    return ["{0:02x}".format(ord(i)) for i in char]

def int_to_binary(bits):
    binary_list = []
    for num in bits:
        binary_data = format(int(num), 'b').zfill(8)
        binary_list.append(binary_data)

    return binary_list

def int_to_hex(bits):
    return binary_to_hex(int_to_binary(bits))




